import React from 'react';
import {
  Grid,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  TextField,
  Button,
  makeStyles,
  Checkbox,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow
} from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
    width: '100%',
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
  button: {
    margin: theme.spacing(1),
  },
  searchField: {
    margin: theme.spacing(1),
    minWidth: 120,
    width: '100%',
  },
  table: {
    minWidth: 650,
  },
  filterContainer: {
    marginBottom: theme.spacing(3),
  },
  buttonContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    padding: theme.spacing(2),
  },
  csvTable: {
    width: '100%',
  },
}));

const LeftColumn = ({
  region, setRegion, platform, setPlatform, promotionType, setPromotionType,
  race, setRace, gender, setGender, furtherLocation, setFurtherLocation,
  avgViews, setAvgViews, filter, setFilter, handleResetFilters, data, selectedItems, handleSelectItem,
  columnsToShow, getColumnWidth, headers, filteredData
}) => {
  const classes = useStyles();

  const handleRegionChange = (event) => setRegion(event.target.value);
  const handlePlatformChange = (event) => setPlatform(event.target.value);
  const handlePromotionTypeChange = (event) => setPromotionType(event.target.value);
  const handleFilterChange = (event) => setFilter(event.target.value);

  return (
    <div>
      <Grid container spacing={3}>
        <Grid item xs={12} className={classes.filterContainer}>
          {/* Filters Section */}
          <FormControl variant="outlined" className={classes.formControl}>
            <InputLabel id="region-label">Region</InputLabel>
            <Select
              labelId="region-label"
              id="region-select"
              value={region}
              onChange={handleRegionChange}
              label="Region"
            >
              <MenuItem value=""><em>None</em></MenuItem>
              {/* Add more regions */}
            </Select>
          </FormControl>
          {/* Repeat for other filters like Platform, Promotion Type, Race, Gender, etc. */}

          <TextField
            id="search-field"
            label="Search"
            variant="outlined"
            className={classes.searchField}
            value={filter}
            onChange={handleFilterChange}
            fullWidth
          />

          <div className={classes.buttonContainer}>
            <Button
              variant="contained"
              color="primary"
              onClick={handleResetFilters}
              className={classes.button}
            >
              Reset Filters
            </Button>
            {/* Include any other buttons like "Add Creators" if necessary */}
          </div>
        </Grid>

        {/* CSV Table Section */}
        <Grid item xs={12}>
          <Paper elevation={3} className={classes.csvTable}>
            <TableContainer>
              <Table className={classes.table} aria-label="simple table">
                <TableHead>
                  <TableRow>
                    <TableCell padding="checkbox">Select</TableCell>
                    {/* Dynamically generate other table headers based on `headers` and `columnsToShow` */}
                  </TableRow>
                </TableHead>
                <TableBody>
                  {filteredData.map((row, index) => (
                    <TableRow key={index}>
                      <TableCell padding="checkbox">
                        <Checkbox
                          checked={selectedItems.has(row.id)}
                          onChange={() => handleSelectItem(row.id)}
                          color="primary"
                        />
                      </TableCell>
                      {/* Dynamically generate other table cells */}
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
};

export default LeftColumn;
